"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[3321],{377:(o,t,s)=>{s.r(t),s.d(t,{assets:()=>l,contentTitle:()=>i,default:()=>g,frontMatter:()=>e,metadata:()=>c,toc:()=>p});var n=s(4848),a=s(8453);const e={title:"Como as mensagens v\xe3o para o motoboy com as taxas configuradas?"},i=void 0,c={id:"configuracoes/como-as-mensagens-vao-para-o-motoboy-com-as-taxas-configuradas-",title:"Como as mensagens v\xe3o para o motoboy com as taxas configuradas?",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/configuracoes/como-as-mensagens-vao-para-o-motoboy-com-as-taxas-configuradas-.mdx",sourceDirName:"configuracoes",slug:"/configuracoes/como-as-mensagens-vao-para-o-motoboy-com-as-taxas-configuradas-",permalink:"/en/docs/configuracoes/como-as-mensagens-vao-para-o-motoboy-com-as-taxas-configuradas-",draft:!1,unlisted:!1,tags:[],version:"current",frontMatter:{title:"Como as mensagens v\xe3o para o motoboy com as taxas configuradas?"},sidebar:"tutorialSidebar",previous:{title:"Novas vari\xe1veis dispon\xedveis no Bot para fornecer informa\xe7\xf5es atualizadas do sistema",permalink:"/en/docs/cadastros/novas-variaveis-disponiveis-no-bot-para-fornecer-informacoes-atualizadas-do-sistema"},next:{title:"Como configurar hor\xe1rio de atendimento?",permalink:"/en/docs/configuracoes/como-configurar-horario-de-atendimento-"}},l={},p=[];function m(o){return(0,n.jsx)(n.Fragment,{children:(0,n.jsx)(n.Fragment,{children:(0,n.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p></p>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 1: Acesse o Facity Controle</strong></p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Abra o <strong>Facity Controle</strong> no seu computador.</li>\n\n\n\n<li class="has-medium-font-size">Fa\xe7a login com seu <strong>usu\xe1rio </strong>e <strong>senha</strong>, ambos em letras <strong>min\xfasculas</strong>.</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="900" height="547" src="https://blog.facity.com.br/wp-content/uploads/2024/10/image.png" alt="" class="wp-image-1766" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/image.png 900w, https://blog.facity.com.br/wp-content/uploads/2024/10/image-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/image-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/image-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 2: </strong>Cadastrando o<strong> motoboy</strong>:</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Clique em <strong>&#8220;usu\xe1rios&#8221;</strong> e depois clique em <strong>&#8220;novo&#8221;</strong></li>\n</ul>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1325" height="591" src="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome2.png" alt="" class="wp-image-1795" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome2.png 1325w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome2-300x134.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome2-1024x457.png 1024w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome2-768x343.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome2-720x321.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 3:</strong> Adicionando as informa\xe7\xf5es:</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Coloque o <strong>nome do motoboy</strong>;</li>\n\n\n\n<li class="has-medium-font-size">Adicione o <strong>numero com o DDD</strong>; </li>\n\n\n\n<li class="has-medium-font-size">Clique em <strong>pr\xf3xima</strong>;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1325" height="591" src="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome5.png" alt="" class="wp-image-1801" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome5.png 1325w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome5-300x134.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome5-1024x457.png 1024w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome5-768x343.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome5-720x321.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 4:</strong> Adicionando <strong>nome</strong> e <strong>senha</strong>:</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Coloque o <strong>mesmo nome do motoboy</strong>;</li>\n\n\n\n<li class="has-medium-font-size">Coloque uma <strong>senha </strong>e <strong>repita ela</strong>;</li>\n\n\n\n<li class="has-medium-font-size">Clique em <strong>Pr\xf3xima</strong>;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1325" height="623" src="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome3.png" alt="" class="wp-image-1797" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome3.png 1325w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome3-300x141.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome3-1024x481.png 1024w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome3-768x361.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome3-720x339.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 5</strong>: Selecionando a <strong>fun\xe7\xe3o correta</strong>;</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Clique em cima de <strong>Motoboy</strong>; </li>\n\n\n\n<li class="has-medium-font-size">Clique em <strong>concluir </strong>para finalizar;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1325" height="623" src="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome4.png" alt="" class="wp-image-1799" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome4.png 1325w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome4-300x141.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome4-1024x481.png 1024w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome4-768x361.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/motoboynome4-720x339.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size">Depois de concluir esses passos, vamos ver como as mensagens chegam ao motoboy. Para simular isso, voc\xea pode fazer um pedido de delivery seguindo os passos abaixo:</p>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 1:</strong> Coloque o <strong>nome da sua empresa </strong>no navegador;</p>\n\n\n\n<p class="has-medium-font-size"><strong>Exemplo</strong>: <strong>nomedasuaempresa</strong>.facitydelivery.com.br</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Clique em <strong>Delivery;</strong></li>\n\n\n\n<li class="has-medium-font-size">Selecione qualquer pedido do seu <strong>card\xe1pio</strong>;</li>\n\n\n\n<li class="has-medium-font-size">Siga os passos a passos at\xe9 <strong>concluir o pedido</strong>;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="462" src="https://blog.facity.com.br/wp-content/uploads/2024/10/demonstramotoboyq-1-1024x462.png" alt="" class="wp-image-1772" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/demonstramotoboyq-1-1024x462.png 1024w, https://blog.facity.com.br/wp-content/uploads/2024/10/demonstramotoboyq-1-300x135.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/demonstramotoboyq-1-768x346.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/demonstramotoboyq-1-720x325.png 720w, https://blog.facity.com.br/wp-content/uploads/2024/10/demonstramotoboyq-1.png 1348w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 2:</strong> Aceitando o pedido e selecionando o motoboy no Facity Pos;</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Aceite o pedido;</li>\n\n\n\n<li class="has-medium-font-size">Clique no \xedcone de<strong> capacete </strong>para selecionar o <strong>Motoboy</strong>;</li>\n\n\n\n<li class="has-medium-font-size">Selecione o <strong>Entregador/Motoboy</strong>;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="653" height="619" src="https://blog.facity.com.br/wp-content/uploads/2024/10/aciietandopedidomoto9.png" alt="" class="wp-image-1779" style="width:841px;height:auto" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/aciietandopedidomoto9.png 653w, https://blog.facity.com.br/wp-content/uploads/2024/10/aciietandopedidomoto9-300x284.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/aciietandopedidomoto9-506x480.png 506w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="482" src="https://blog.facity.com.br/wp-content/uploads/2024/10/motobouysselecionado10-1024x482.png" alt="" class="wp-image-1780" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/motobouysselecionado10-1024x482.png 1024w, https://blog.facity.com.br/wp-content/uploads/2024/10/motobouysselecionado10-300x141.png 300w, https://blog.facity.com.br/wp-content/uploads/2024/10/motobouysselecionado10-768x361.png 768w, https://blog.facity.com.br/wp-content/uploads/2024/10/motobouysselecionado10-720x339.png 720w, https://blog.facity.com.br/wp-content/uploads/2024/10/motobouysselecionado10.png 1326w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-medium-font-size"><strong>Passo 3</strong>: Chegando a mensagem:</p>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Ap\xf3s selecionar o <strong>Motoboy</strong>;</li>\n\n\n\n<li class="has-medium-font-size">Chegar\xe1 uma mensagem com o pedido para ele e a localiza\xe7\xe3o do <strong>Google Maps</strong>;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-large is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="472" height="1024" src="https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.23.21-1-472x1024.jpeg" alt="" class="wp-image-1793" style="width:829px;height:auto" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.23.21-1-472x1024.jpeg 472w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.23.21-1-138x300.jpeg 138w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.23.21-1-708x1536.jpeg 708w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.23.21-1-221x480.jpeg 221w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.23.21-1.jpeg 738w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<ul class="wp-block-list">\n<li class="has-medium-font-size">Clicando no<strong> link </strong>o <strong>Motoboy </strong>vai ter as melhores rotas para chegar at\xe9 o destino;</li>\n</ul>\n\n\n\n<figure class="wp-block-image size-large is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="472" height="1024" src="https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.21.36-472x1024.jpeg" alt="" class="wp-image-1787" style="width:812px;height:auto" srcset="https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.21.36-472x1024.jpeg 472w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.21.36-138x300.jpeg 138w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.21.36-708x1536.jpeg 708w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.21.36-221x480.jpeg 221w, https://blog.facity.com.br/wp-content/uploads/2024/10/WhatsApp-Image-2024-10-10-at-22.21.36.jpeg 738w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p></p>\n\n\n\n<p class="has-medium-font-size">Esse processo facilita a comunica\xe7\xe3o entre a <strong>empresa</strong> e o <strong>motoboy</strong>, tornando as entregas mais r\xe1pidas e eficientes. Com esses passos, fica mais simples gerenciar os entregadores e melhorar a experi\xeancia dos clientes.</p>\n\n\n\n<p></p>\n\n'}})})})}function g(o={}){const{wrapper:t}={...(0,a.R)(),...o.components};return t?(0,n.jsx)(t,{...o,children:(0,n.jsx)(m,{...o})}):m()}},8453:(o,t,s)=>{s.d(t,{R:()=>i,x:()=>c});var n=s(6540);const a={},e=n.createContext(a);function i(o){const t=n.useContext(e);return n.useMemo((function(){return"function"==typeof o?o(t):{...t,...o}}),[t,o])}function c(o){let t;return t=o.disableParentContext?"function"==typeof o.components?o.components(a):o.components||a:i(o.components),n.createElement(e.Provider,{value:t},o.children)}}}]);